import Filter from "../component/Filter"
import List from "../component/List"

export default function Bookmark({filter, setFilter, setFilterHandler, book, setBook, list, marked, setMarked}){
  const items = list.slice(0,4)

  return(
    <article>
      <Filter filter={filter} setFilter={setFilter} setFilterHandler={setFilterHandler} items={items} marked={marked} setMarked={setMarked} />
      <div className='itemContainer'>
      {list.map((item)=>{
            if(sessionStorage.getItem(item.id)){
              return <List item={item} book={book} setBook={setBook} marked={marked} setMarked={setMarked} /> 
            }
          })}
      </div>
    </article>
  )
}
